import React from 'react';
import ReactDOM from 'react-dom';
import App from './App.js';

class TodoList extends React.Component {
    render() {
        return(<h1>This will be a To-Do List</h1>);
    }
}

ReactDOM.render(
    <TodoList />, 
    document.getElementById('root')
);
